         A7*Yred*(3*Math.pow(Xred,2)-Math.pow(Yred,2))-4*A10*Yred*Xred*(Math.pow(Xred,2)-Math.pow(Yred,2))+A9*(Math.pow(Xred,4)+Math.pow(Yred,4)-6*Math.pow(Xred,2)*Math.pow(Yred,2));
